install instructions:

copy and replace any previous version
run abyssws.exe and follow its instructions

if you already have a abyss.conf, delete it. if for whatever reason u dont want to delete it and it bitches about the code being invalid or sumthing then open abyss.conf in notepad and near the bottom of the file replace the license info. it looks sumthing like this:

&lt;license&gt;
		&lt;info&gt;
			&lt;name&gt;
				[insert name]
			&lt;/name&gt;
			&lt;key&gt;
				L0-XXXX-XXXX-XXXX-XXXX
			&lt;/key&gt;
		&lt;/info&gt;
		&lt;prodkey&gt;
			P0-XXXX-XXXX-XXXX-XXXX-XXXX-XXXX
		&lt;/prodkey&gt;
	&lt;/license&gt;


